import Sidebar from '../Sidebar'

//Defining default layout that is gonna be used in app
const Layout = () =>{

    return (
    <div className='App'>
        
       < Sidebar />
       <div className='page'>
        <span className="tags top-tags">&lt;body&gt;</span>

       </div>
    </div>
    )
}

export default Layout
